from flask import request, Blueprint
from flask_jwt_extended import jwt_required, get_jwt_identity

from app.controllers.user import crud_user
from app.services.errors.default_errors import treated_errors
from app.services.jwt.token import generate_user_jwt
from app.services.requests.requests import default_return

client_bp = Blueprint('client', __name__, url_prefix="/client")


@client_bp.route('', methods=['POST'])
def item_multi_routes():
    try:
        item = crud_user.create_user(schema=True, specific_group_id=2)
        item['auth'] = generate_user_jwt(item)
        return default_return(201, 1, item)
    except treated_errors as e:
        return default_return(e.status_code, e.message, {"Error": str(e)})
    except Exception as e:
        raise e


@client_bp.route('', methods=['GET', 'PUT', 'DELETE'])
@jwt_required()
def item_routes():
    """
    ---
    get:
      security:
        - jwt: []
      description: State
      responses:
        '200':
          description: call successful
          content:
            application/json:
              schema: UserSchema
      tags:
          - Client

    put:
      security:
        - jwt: []
      requestBody:
        description: Optional description in *Markdown*
        required: true
        content:
          application/json:
            schema: UserSchema
      responses:
        '200':
          description: call successful
          content:
            application/json:
              schema: UserSchema
      tags:
          - Client

    delete:
      security:
        - jwt: []
      description: State
      responses:
        '200':
          description: call successful
          content:
            application/json:
              schema: UserSchema
      tags:
          - Client
    """
    try:
        user_jwt = get_jwt_identity()
        if request.method == 'GET':
            item = crud_user.get_user_by_jwt(user_jwt, True)
            return default_return(200, 2, item)

        if request.method == 'PUT':
            item = crud_user.update_user(user_jwt['user_id'], True)
            return default_return(200, 3, item)

        if request.method == 'DELETE':
            crud_user.delete(user_jwt['user_id'])
            return default_return(204, 4)
    except treated_errors as e:
        return default_return(e.status_code, e.message, {"Error": str(e)})
    except Exception as e:
        raise e


@client_bp.route('/image', methods=['PUT', 'DELETE'])
@jwt_required()
def item_image():
    """
    ---
    put:
      security:
      - jwt: []
      requestBody:
        required: true
        content:
          application/json:
            schema: ImageSchema
            example:
              file: data:image/jpeg;base64,
      responses:
        '200':
          description: Updated successfully
          content:
            application/json:
              schema: ImageSchema
      tags:
          - Client

    delete:
      security:
      - jwt: []
      responses:
        '200':
          description: Deleted successfully
      tags:
          - Client
    """
    try:
        user_jwt = get_jwt_identity()
        if request.method == 'PUT':
            item = crud_user.put_file(item_id=user_jwt['user_id'],
                                      column_key='image_key',
                                      path='user_client')
            return default_return(200, 3, item)

        if request.method == 'DELETE':
            crud_user.delete_file(item_id=user_jwt['user_id'],
                                  column_key='image_key')
            return default_return(200, 4)
    except treated_errors as e:
        return default_return(e.status_code, e.message, {"Error": str(e)})
    except Exception as e:
        raise e


@client_bp.route('/password', methods=['PUT'])
@jwt_required()
def item_update_password_routes():
    """
    ---

    put:
      security:
        - jwt: []
      requestBody:
        required: true
        content:
          application/json:
            schema: UserSchema
            examples:
              for updating client data and password:
                value:
                  password: senha_antiga
                  new_password: nova_senha
      responses:
        '200':
          description: Updated successfully
          content:
            application/json:
              schema: UserSchema
      tags:
          - Client

    """
    try:
        user_jwt = get_jwt_identity()
        if request.method == 'PUT':
            item = crud_user.update_password(
                item_id=user_jwt['user_id'],
                schema=True)
            return default_return(200, 3, item)
    except treated_errors as e:
        return default_return(e.status_code, e.message, {"Error": str(e)})
    except Exception as e:
        raise e
